import React from "react";
import {
  FaCartArrowDown,
  FaFacebook,
  FaInstagram,
  FaWhatsapp,
} from "react-icons/fa";
import { Link } from "react-router-dom";
const Navbar = () => {
  return (
    <section className="flex justify-around items-center bg-gray-100 ">
      <nav className="flex gap-10">
        {/* logo */}
        <p className="text-2xl sm:text-5xl text-gray-800 capitalize font-serif">
          All-Hadi
        </p>
        <Link to="/">Home</Link>
        <Link to="/">Login</Link>
        <Link to="/">Sign-Up</Link>
      </nav>
      <div className="flex">
        {/* social Icons  */}
        <div className="flex">
          <FaFacebook />
          <FaWhatsapp />
          <FaInstagram />
        </div>
        <Link to="/cart">
          <FaCartArrowDown />
        </Link>
      </div>
    </section>
  );
};

export default Navbar;
